export const useFilterType = ({search}) => {
  const searchParams = new URLSearchParams(decodeURIComponent(search).replace(/,/g, '+'));
  const queryStringKey = searchParams.get('type')
  console.log("queryStringKey",queryStringKey)
  // fn1: {type: red} 와 같은 type 값을 리턴해주어야지 인자 값으로 pathname,search를 받아서

  // fn2 라우팅 기능, searchparams는 return을 최종 string 형태로 하게됨.
  // fn2 함수를 호출할때 routerTo(fn2(key 등 인자 값))

  return {
    queryString: [""]
    // fn2
  }
}
